import React from "react";
import {
  BrowserRouter as Router,
  Route,
  Routes,
  Link
} from "react-router-dom";
import Dashboard from "./pages/dashboard";
import Table from "./pages/tables";


const Home = () => {
  return (
    <div>
      <Link to="/">Home</Link>
      <Link to="/about">About</Link>
      <h1>Home</h1>
      <h2>Home page</h2>
    </div>
  );
}

const About = () => {
  return (
    <div>
      <Link to="/">Home</Link>
      <Link to="/about">About</Link>
      <h1>About</h1>
      <h2>About page</h2>
    </div>
  );
}

const App = () => {
  return (
    // <Router>
