    //       <Home />
    //     </Route>

    //     <Route path="/about" exact>
    //       <About />
    //     </Route>
    //   </Routes>
    // </Router>
    // <Home />
    <Router>
      {/* <a href="/home">Go to home page</a> */}
      <Routes>
        <Route path="/" element={<Table />} />
        <Route path="/" element={<Dashboard />} />
      </Routes>
    </Router>
  );
}
export default App;
